import React from 'react';

import {Layout, Menu} from 'antd';

//  https://medium.com/zestgeek/ant-design-navbar-with-responsive-drawer-a8d718e471e0
export default function Navigation(){

  const {Header} = Layout;

  return (
    <div>
    <Header style={{ position: 'fixed', zIndex: 1, width: '100%', backgroundColor: 'rgba(0,0,0,0)', lineHeight: '0dx'}}>

      <Menu mode="horizontal" defaultSelectedKeys={['2']} style={{textAlign:'center',backgroundColor: 'rgba(0,0,0,0)'}}>
        {/* <Menu.Item key="1">로그인/회원가입</Menu.Item> */}
        <Menu.Item key="1" title='Apple Farm'></Menu.Item>
        {/* <Menu.Item key="3">nav 3</Menu.Item> */}
      </Menu>
    </Header> 
    </div>
  );
}
